import video from '../videos/video_tammy.mp4'
import { forwardRef } from 'react';

function Video(props, ref) {

    return (
        <>
            <div>
                <video ref={ref} style={{ width: 300, height: 360 }} src={video} ></video>

            </div>
        </>
    )
}
export default forwardRef(Video);
